import React from 'react'

const Home = () => {

  var styles = {
    h1: {
      // padding: "100px",
      // fontsize: "300%",
      //margin: "auto",
     width: "1000px",
      position: "absolute",
      top: "20%",
      left: "57%",
      transform: "translate(-50%, -50%)"
    },
    img: {
      //padding: "200px",
      right:"0%"
    }
  }

  return (

    <div class="container">
      <img style={styles.img} src="https://jsmsikkim.com/images/11.png" />
      <h1 class="center" style={styles.h1}>Welcome to Real Estate Broker Application</h1>

    </div>
  );
}

export default Home
